import React from "react"

const Textfield = ({ text, onclick, onhover, name, placeholder, type }) => {
  return (
    <div
      className="search-text"
      onClick={onclick}
      onHover={onhover}
      placeholder={placeholder}
      name={name}
      type={type}
    />
  )
}
export default Textfield
